import { content } from "../../data/String";
import { Title,LogoImage} from "./styles";
import { image } from "../../resources/Images";
LogoImage.defaultProps = {
  src: image ,
};

const Header:React.FC=()=> {

    return (
     <div>
     <Title>

      <LogoImage >
        <img src={image.logo}></img></LogoImage>
      <div>{content.heading}</div>
      <div>{content.text}</div>
      
    
     </Title>
     </div>

    );
  }
  export default Header;
